import { Item } from '../Item/Item';

export const ItemList = ( {listProducts} ) => {
  return (
    <div className="products container">
      { listProducts.map( (prod) => (
      <Item 
      key={prod.id} 
      id={prod.id}
      nombre={prod.name} 
      imagen={prod.image} 
      descripImagen={prod.altImage} 
      categoria={prod.category} 
      precio={prod.price} 
      oferta={prod.noOffer} 
      stock={prod.stock}
      /> 
      ) ) }
    </div>
  )
};
